import { Cont, Tit2, Btn, BtnCont,Img } from './styled.Card.js';

export default function Card(props) {
 const { id,name,life_span,image } = props;
 return (
  <Cont>
     <BtnCont>
         <Btn>Boton1</Btn>
         <Btn>Boton2</Btn>
     </BtnCont>
          <Tit2> Componente Perritos Guau Guau</Tit2>
          <Tit2> desc1 {id}</Tit2>
          <Tit2> desc2 {name}</Tit2>
          <Tit2> desc3 {life_span}</Tit2>

          <Img src={image} alt={name} />
  </Cont>
 )
}
